DEFINE USER_NAME = &&1
DEFINE TABLESPACE_NAME = "&&USER_NAME._DATA"

CREATE TABLE GoogleExcelTable ( 
  BATCH_NUMBER NUMBER NOT NULL,
  BATCH_STATUS VARCHAR(500),
  CUSTOMER_NAME VARCHAR(500),
  ADDRESS VARCHAR(500),
  TRANSPORT VARCHAR(500),
  BOX_WEIGHT NUMBER(10,5),
  BOX_TYPE VARCHAR(500),
  BOX_PRICE NUMBER(10,5),
  BOX_COUNT NUMBER,
  PRODUCT_NAME VARCHAR(500),
  PRODUCT_PRICE NUMBER(10,5),
  PRODUCT_WEIGHT NUMBER(10,5),
  SHELF_LIFE NUMBER,
  FOOD_ENERGY NUMBER(10,5),
  PROTEIN NUMBER(10,5),
  FATS NUMBER(10,5),
  CARBONOHYDRATES NUMBER(10,5),
  COCOA NUMBER(10,5),
  CONSTRAINT batch_pk 
    PRIMARY KEY (BATCH_NUMBER,BATCH_STATUS,CUSTOMER_NAME,ADDRESS,TRANSPORT,BOX_WEIGHT,BOX_TYPE,BOX_PRICE,BOX_COUNT,PRODUCT_NAME,PRODUCT_PRICE,PRODUCT_WEIGHT,SHELF_LIFE,FOOD_ENERGY,PROTEIN,FATS,CARBONOHYDRATES,COCOA)
)
TABLESPACE &&TABLESPACE_NAME;


UNDEFINE USER_NAME
UNDEFINE TABLESPACE_NAME
UNDEFINE TABLESPACE_INDEX_NAME